import React from 'react'
import allCountryScores from './scores'

function HighScoreTable() {
  return (
    <div>
        <ul></ul>
      {allCountryScores.map((score) => {
        <p>{score.name}</p>
      })}
    </div>
  )
}

export default HighScoreTable
